import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import VisitorTrackingApp from "./VisitorTrackingApp";
import ReceptionistPanel from "./ReceptionistPanel"; // if Phase 1 is separated

export default function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Navigate to="/dashboard" />} />
        <Route path="/dashboard" element={<VisitorTrackingApp />} />
        <Route path="/reception" element={<ReceptionistPanel />} />
      </Routes>
    </Router>
  );
}
